Informamos que o presente processo, referente à contratação direta com fulcro no inciso I do artigo 29 da Lei nº 13.303/2016, cujo valor global é de R$ 40.483,09 (quarenta mil, quatrocentos e oitenta e três reais e nove centavos), preenche os seguintes requisitos legais e regulamentares:

O planejamento da contratação foi realizado em conformidade com a legislação vigente, especialmente o art. 16 do Regulamento de Licitações, Contratos e Convênios da Embrapa;

O valor global da contratação encontra-se dentro do limite estabelecido pelo artigo 29, inciso I, da Lei nº 13.303/2016, e pelo artigo 101 do Regulamento de Licitações, Contratos e Convênios da Embrapa;

A presente contratação é viável mediante a utilização de minuta contratual pré-aprovada, constante do Processo SEI nº 21148.004367/2024-83, conforme Minuta SEI nº 11305687.
